import React, { Component } from "react";

class Try extends Component {
  render(props) {
    console.log(this.props.array)
    return (
      <div>
        <ul>

        {(this.props.array.map((item) => <li>{item}</li>))} 
        </ul>
      </div>

    );
  }
}

export default Try;
